import React from 'react';
import classes from "../Navigation/Navigation.css";
import Login from '../Pages/Login/Login';
import Registration from '../Pages/Registration/Registration';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

const Navigation = () => {

    const logout = () => {
        localStorage.removeItem('userDetails')
    }

    return (
        <div className="navigation">
            <Link to="/login" className="link">Login</Link>
            <Link to="/registration" className="link">Registration</Link>
            <Link to="/monthly" className="link">Monthly Balance</Link>
            <Link to="/yearly" className="link">Yearly Balance</Link>
            {"userDetails" in localStorage ? <button onClick={logout}> Logout</button> : ""}
        </div >
    )
}

export default Navigation;
